function map(){
    var ary=[22,45,67,2];
    var b=ary.map(test);
    document.write(b);
    function test(x){
        return x*10;
    }
}
function map2(){
    var ary=[
        {fname:"Hilal", lname: "Ahmad"}
];
    var b=ary.map(test);
    document.write(b);
    function test(x){
        return x*10;
    }
}
export default map;
export {map2};
